import { Component, OnInit } from '@angular/core';

@Component({
  selector: 'app-nav',
  templateUrl: './nav.component.html',
  styleUrls: ['./nav.component.css']
})
export class NavComponent implements OnInit {
  isCollapsed = true;

  constructor() { }

  ngOnInit() {
  }

}
<nav class="navbar navbar-expand-lg bg-body-tertiary">class="navbar bg-dark" data-bs-theme="dark"
  <div class="container-fluid">
    <a class="navbar-brand" href="#">CadCell</a>
    <button class="navbar-toggler" (click)="isCollapsed = !isCollapsed" type="button" data-bs-toggle="collapse" data-bs-target="#navbarNav" aria-controls="navbarNav" aria-expanded="false" aria-label="Toggle navigation">
      <span class="navbar-toggler-icon"></span>
    </button>
    <div class="collapse navbar-collapse" [collapse]="isCollapsed" [isAnimated]="true" id="navbarNav">
      <ul class="navbar-nav">
        <li class="nav-item">
          <a class="nav-link active" aria-current="page" href="#">Clientes</a>
        </li>
        <li class="nav-item">
          <a class="nav-link" href="#">Equipamento</a>
        </li>
        <li class="nav-item">
          <a class="nav-link" href="#">Orçamento</a>
        </li>
      </ul>
    </div>
  </div>
</nav>
